import React from "react";
import { Link } from "react-scroll";

function Navbar() {
  return (
    <React.Fragment>
      <div className="home_page_navbar">
        <div className="ui container">
          <div className="ui secondary menu">
            <Link className="logo">
              <img src="/image/grood-w.png" />
            </Link>
            <div className="right menu">
              <Link
                className="active item"
                to="what"
                spy={true}
                smooth={true}
                offset={23}
                duration={500}
              >
                What's Grood?
              </Link>
              <Link
                className="item"
                to="why"
                spy={true}
                smooth={true}
                offset={600}
                duration={500}
              >
                For Better World!
              </Link>
              <a className="listbtn">
                <button className="insize ui button">Pre-Order Now</button>
              </a>
              <img src="/image/menu.png" alt="" />
            </div>
          </div>

          <div class="ui left demo vertical sidebar labeled icon menu">
            {/* visible */}
            <Link
              className="active item"
              to="what"
              spy={true}
              smooth={true}
              offset={23}
              duration={500}
            >
              What's Grood?
            </Link>
            <Link
              className="item"
              to="why"
              spy={true}
              smooth={true}
              offset={600}
              duration={500}
            >
              For Better World!
            </Link>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Navbar;
